import styled from "styled-components";

const CreateStyled = styled.div`
    padding-top:4rem;
    background-color:#144698;


`;

const Create = () => (
    <CreateStyled>
        <div class="columns is-mobile is-centered">
            <div class="column is-half has-text-centered  is-spaced">
                <h2 class="title is-2 has-text-white has-text-weight-semibold">
                    Enter the Future of Finance
                </h2>
                <h3 class="subtitle is-3 has-text-grey-light">Empowering individual, investors, and developers to join the revolution</h3>
            </div>
        </div>

    </CreateStyled>
);

export default Create;
